import React from 'react';
import { Container } from './ProjectElements';

const Skill = (props) => {
    const name = props.title;
    const image = props.image;

    return (
        <Container>
            <img src={image} alt={name} />
            <span>{name}</span>
        </Container>
    );
}

export default Skill;
